import time
from collections import deque

def ls(nums: list[int], limit: int) -> int:
    left = 0
    length = len(nums)
    mx = 0
    min_ = deque()
    max_ = deque()
    #idea here is we can store largest and smallest in sorted arr
    for i, n in enumerate(nums):

        while max_ and nums[max_[-1]] <= n:
            max_.pop()
        max_.append(i)
        while min_ and nums[min_[-1]] >= n:
            min_.pop()
        min_.append(i)
        print(min_, max_)
        while nums[max_[0]]-nums[min_[0]] > limit:
            left+=1
            if left > min_[0]:
                min_.popleft()
            if left > max_[0]:
                max_.popleft()
        print(left)
        if mx < i - left + 1:
            mx = i - left + 1
    return mx


